import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
    return (
        <div className="sidebar">
            <ul>
                <li>Requirements</li>
                <li>Connect</li>
                <li>Requests</li>
                <li>Update Profile</li>
                <li>Logout</li>
            </ul>
        </div>
    );
};

export default Sidebar;
